    public function getSourceContext()
    {
        return new Source("<!DOCTYPE html>
<html>
    <head>
        <meta charset=\"UTF-8\" />
        {% include 'includes/front/css.html.twig' %}
        {% block stylesheets %}{% endblock %}
    </head>
    <body>
        {% include 'includes/front/navbar.html.twig' %}
        {#<div>
            {% if is_granted(\"IS_AUTHENTICATED_REMEMBERED\") %}
                {{ 'layout.logged_in_as'|trans({'%username%': app.user.username}, 'FOSUserBundle') }} |
                <a href=\"{{ path('fos_user_security_logout') }}\">
                    {{ 'layout.logout'|trans({}, 'FOSUserBundle') }}
                </a>
            {% else %}
                <a href=\"{{ path('fos_user_security_login') }}\">{{ 'layout.login'|trans({}, 'FOSUserBundle') }}</a>
            {% endif %}
        </div>#}

        {% if app.request.hasPreviousSession %}
            {% for type, messages in app.session.flashbag.all() %}
                {% for message in messages %}
                    <div class=\"uk-alert-{{ type }}\" uk-alert>
                        <a class=\"uk-alert-close\" uk-close></a>
                        <p>{{ message }}</p>
                    </div>
                {% endfor %}
            {% endfor %}
        {% endif %}
        <div class=\"uk-container\" style=\"margin-top: 20px;margin-bottom: 20px;\">
        <div class=\"uk-card uk-card-default uk-width-1-3@m\" style=\"margin-left: 34%;\">
            <div class=\"uk-card-header\">
                <div class=\"uk-grid-small uk-flex-middle\" uk-grid>
                    Login
                </div>
            </div>
            <div class=\"uk-card-body uk-text-center\">
                {% block fos_user_content %}
                {% endblock fos_user_content %}
            </div>
        </div>
        </div>
        {% include 'includes/front/footer.html.twig' %}
        {% include 'includes/front/js.html.twig' %}
        {% block javascripts %}{% endblock %}
    </body>
</html>
", "FOSUserBundle::layout.html.twig", "/var/www/html/ggscore/app/Resources/FOSUserBundle/views/layout.html.twig");
